pragma solidity >=0.4.22 <0.8.0;
import './Famepay.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';

contract FamepayFactory {
    using SafeMath for uint256;

    address payable private platform;
    mapping(uint256 => address) private famepayCampaigns;
    event NewFamepayCampaignCreated(
        address _influencer,
        address _business,
        uint256 _campaignId,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _jackpotPayment,
        uint256 _incrementalPayment,
        uint256 _jackpotTargetAmount,
        uint256 _incrementalTargetAmount,
        uint256 _potentialPayoutAmount,
        string _name,
        string _objective
    );

    constructor() public {
        platform = msg.sender;
    }


    uint256 incrementalPaymentsTillJackpotValue;
    uint256 incrementalPaymentsTillJackpotAmount;
    function newFamepayCampaign(
        address payable _business,
        address payable _influencer,
        uint256 _campaignId,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _jackpotPayment,
        uint256 _incrementalPayment,
        uint256 _jackpotTargetAmount,
        uint256 _incrementalTargetAmount,
        uint256 _potentialPayoutAmount,
        string memory _name,
        string memory _objective
    ) payable public {
        incrementalPaymentsTillJackpotAmount = _jackpotTargetAmount.div(_incrementalTargetAmount);
        incrementalPaymentsTillJackpotValue = _incrementalPayment.mul(incrementalPaymentsTillJackpotAmount);
        require(_potentialPayoutAmount > _jackpotPayment.add(incrementalPaymentsTillJackpotValue), "The potential payout is invalid");
        // require(_potentialPayoutAmount > _jackpotPayment.add(_incrementalPayment.mul(_jackpotTargetAmount.div(_incrementalTargetAmount))));
        Famepay famepay = new Famepay{value: msg.value}(platform, _influencer, _business, _campaignId, _startDate, _deadline, _jackpotPayment, _incrementalPayment, _jackpotTargetAmount, _incrementalTargetAmount, _potentialPayoutAmount, _name, _objective) ;
        famepayCampaigns[_campaignId] = address(famepay);
        emit NewFamepayCampaignCreated( _influencer, _business, _campaignId, _startDate, _deadline, _jackpotPayment, _incrementalPayment, _jackpotTargetAmount, _incrementalTargetAmount, _potentialPayoutAmount, _name, _objective);
    }

    function getCampaign(uint256 _campaignId) view public returns (address) {
         return famepayCampaigns[_campaignId];
    }
}
